import React from "react";
import Product from "../components/Product";
import { Container, Row, Col } from "react-bootstrap";

const ProductsListScreen = () => {
  const products = [
    {
      name: "Carrot",
      price: "20 cedis",
      weight: "10kg",
      category: "vegetable",
    },
    {
      name: "yam",
      price: "20 cedis",
      weight: "10kg",
      category: "tuber",
    },
    {
      name: "rice",
      price: "20 cedis",
      weight: "10kg",
      category: "cereal",
    },
    {
      name: "pawpaw",
      price: "20 cedis",
      weight: "10kg",
      category: "fruit",
    },
  ];

  return (
    <div>
      <h1>List of product</h1>
      <Container>
        all | vegetables | cereals | fruits | seedlings | agro-chemicals
        <Row>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product name="Cabbage" price="60.00" wieght="10kg" />
          </Col>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product name="Carrot" price="20.00" wieght="20kg" />
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default ProductsListScreen;
